function setScreenForStatus(data) {
    if (data!==null && data.UserGuid != defaultUser.UserGuid) {
        defaultUser.UserGuid = data.UserGuid;
        defaultUser.UserFullName = data.UserFullName;
        defaultUser.OperatorDeskNumber = data.OperatorDeskNumber;

        $("#qMonitorOperator .leftArea p").text(defaultUser.UserFullName);
        $("#qMonitorOperator .rightArea h1").text(defaultUser.OperatorDeskNumber);
    }

    var startDate = Date.parse(data.ChangeDate);
    var dateNow = Date.parse(new Date());//Date.now();

    var diff = dateNow - startDate; // this is a time in milliseconds
    if (diff < 0) diff = 0;

    var isvip = data.Vip;
    var vipprefix = $("#vipprefix").val();

    var ticketnumber;
    if (isvip)
        ticketnumber = data.QueueNumber + vipprefix;
    else
        ticketnumber = data.QueueNumber;

    switch (data.OperatorDeskStatus) {
        case 1:
        case 5:
            setNotServedStatus(data.CurrentBreakType, data.MonitorStatus);
            break;
        case 2:
        case 6:
            setWaitForQueueStatus();
            break;
        case 3:
            var restsconds = data.WaitForServicePeriod * 60 - diff / 1000 ;
            setWaitForServiceStatus(ticketnumber, data.CustomerFullName, data.CustomerImage, restsconds / 60, data.WaitForServicePeriod);
            break;
        case 4:
            setInServiceStatus(ticketnumber, data.CustomerFullName, data.CustomerImage, data.ChangeDate);
            break;
    }
    var operatorDiv;
    if (data.OperatorDeskStatus === 5) {
        if (!$("#qMonitorOperator .mainRow[data-attr='1']").find("#qOperators").length) {
            operatorDiv = $("#qMonitorOperator .mainRow[data-attr='2']").find("#qOperators");
            $("#qMonitorOperator .mainRow[data-attr='2']").remove("#qOperators");
            var serviceStatus = $("#qMonitorOperator .mainRow[data-attr='1']").find(".serviceStatus");
            operatorDiv.find(".boxHeading").hide();
            serviceStatus.after(operatorDiv);
            
            //$("#qMonitorOperator .mainRow[data-attr='1' .col-12]").append(operatorDiv);
        }
    }
    else {
        if (!$("#qMonitorOperator .mainRow[data-attr='2']").find("#qOperators").length) {
            operatorDiv = $("#qMonitorOperator .mainRow[data-attr='1']").find("#qOperators");
            $("#qMonitorOperator .mainRow[data-attr='1']").remove("#qOperators");
            var progressArea = $("#qMonitorOperator .mainRow[data-attr='2']").find(".progressArea");
            operatorDiv.find(".boxHeading").show();
            progressArea.after(operatorDiv);
        }
        else {
            operatorDiv = $("#qMonitorOperator .mainRow[data-attr='2']").find("#qOperators");
        }
    }
    if (data.OperatorDeskStatus === 3) {
        operatorDiv.hide();
    }
    else {
        operatorDiv.show();
    }

    var diff_as_date = new Date(diff);
    var hours = diff_as_date.getUTCHours(); // hours
    var minutes = diff_as_date.getUTCMinutes(); // minutes
    var secnds = diff_as_date.getUTCSeconds(); // seconds

    $("#qOperators .operatorBox .serviceTime .hour").text(hours);
    $("#qOperators .operatorBox .serviceTime .minute").text(minutes);
    $("#qOperators .operatorBox .serviceTime .second").text(secnds);
}

function setNotServedStatus(breakstatus, monitorstatus) {
    if (breakstatus === 0) {
        var notServedStatus = GetStrinResource("notServedStatus");
        $("#qMonitorOperator .mainRow[data-attr='1'] h1.serviceStatus").text(notServedStatus);//"XDMT GSTRLMR");
    }
    else
        $("#qMonitorOperator .mainRow[data-attr='1'] h1.serviceStatus").text(monitorstatus);

    $("#qMonitorOperator .mainRow[data-attr='1']").removeClass("d-none");
    $("#qMonitorOperator .mainRow[data-attr='2']").addClass("d-none");
    $("#qMonitorOperator .mainRow[data-attr='2']").removeClass("inservice");
}

var prInterval;
var timerInterval;
var secinterv;
function serviceTimeStart(/*dateObj*/) {

    var nowHour = $("#qOperators .operatorBox .serviceTime .hour");
    var nowMinute = $("#qOperators .operatorBox .serviceTime .minute");
    var nowSecond = $("#qOperators .operatorBox .serviceTime .second");
    timerInterval = setInterval(() => {

        var h = Number($(nowHour).text());
        var m = Number($(nowMinute).text());
        var s = Number($(nowSecond).text());

        s++;
        if (s < 10) {
            s = "0" + s;
        }
        else if (s > 59) {
            s = "00";
            m++;
            if (m > 59) {
                m = "00";
                h++;
            }
        }
        if (m < 10) {
            m = "0" + m;
        }
        if (h < 10) {
            h = "0" + h;
        }
        $(nowSecond).text(s);
        $(nowMinute).text(m);
        $(nowHour).text(h);
    }, 1000);
}


