var interval;
var interval2;

function setTimer(str) {
    if (str == 'refresh') {
        clearInterval(interval);
        clearInterval(interval2);
    }
    else {



        var currentValue = Number($(".mainProgressValue").text());
        if (currentValue > 0) {
            var tm = currentValue * 10;

            interval2 = setInterval(() => {
                var currentValue2 = Number($(".mainProgressValue").text());

                $(".mainProgressValue").text(--currentValue2);

                if (currentValue2 == 0) {
                    console.log(str)
                    clearInterval(interval2);
                }
            }, 1000);

            var curr = 0;
            interval = setInterval(() => {
                curr++;
                demoProgressBar.setProgressBarValue(curr);
                if (curr == 100) {
                    clearInterval(interval);
                }
            }, tm);
        }
        else
            demoProgressBar.setProgressBarValue(100);

    }

}


function GetStrinResource(resourcename) {
    var resources = StringResourceList();
    var foundresptce = resources.find(x => x.StringResourceEnumName === resourcename);
    return foundresptce.ResourceContent;
}

